import "./App.css";
import Header from "./components/pages/common/Header/Header";
import LoginPage from "./components/pages/Login/Login";
import { Routes, Route } from "react-router-dom";
import RegistrationPage from "./pages/registration/RegistrationPage";
import NotMail from "./pages/notMail/notMail";
import ConfirmPage from "@/components/pages/Confirm/Confirm";

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path="/" element={<LoginPage />}></Route>
        <Route path="/registration" element={<RegistrationPage />}></Route>
        <Route path="/confirm" element={<ConfirmPage />}></Route>
        <Route path="/not_mail" element={<NotMail />}></Route>
      </Routes>
    </div>
  );
}

export default App;
